import { createSlice } from "@reduxjs/toolkit";

const initialState = {
  providerData: [],
  isDataChanged: false,
};

const providerSlice = createSlice({
  name: "provider",
  initialState,
  reducers: {
    getProviderData(state, action) {
      state.providerData = action.payload.data;
    },
  },
});

export default providerSlice;
